import React from 'react'

const ButtonIcon = ({icon}) => {
    return (
        <button className=' rounded-full inline-flex items-center justify-center py-3 px-7 text-center text-base font-medium hover:bg-lightGrey'>
            {icon}
        </button>
    )
}
export default ButtonIcon
